/*Data for the table `announcement` */

insert  into `announcement`(`announcement_id`,`admin_id`,`title`,`content`,`created_at`) values (1,2001,'系统维护通知','为提升系统性能，将于 2024-03-15 00:00 至 03:00 进行数据库升级，期间服务可能出现短暂中断。','2024-03-10 14:30:00'),(2,2001,'竞赛报名截止提醒','2024年春季编程大赛报名将于 2024-03-20 23:59 截止，请未提交的学生尽快完成报名。','2024-03-18 09:15:00'),(3,2001,'获奖名单公示','2023年全国数学建模竞赛获奖名单已发布，请登录系统查看详情。附件：<a href=\"/files/awards.pdf\">下载链接</a>','2024-03-22 16:00:00'),(4,2001,'账号安全升级公告','	为全面提升平台安全防护能力，防范日益复杂的网络攻击风险，现面向全体用户启动​​账号安全强化专项行动​​。根据国家网络安全等级保护2.0标准及教育行业数据安全规范要求，所有用户（含学生、教师、管理员）须于2025年6月1日24:00前完成密码更新操作​​。逾期未完成者，账号将暂时冻结直至密码重置。\r\n\r\n​​1.操作指引​​\r\n​​密码修改路径​​\r\n通过「我的-密码修改」完成操作。\r\n​​2.密码强度要求​​\r\n长度不少于8位，需包含大写字母、小写字母、数字及特殊符号（如!@#$%^&*）。\r\n禁止使用连续字符（如123456）、简单重复（如aaaaaa）或与用户名关联的弱密码。\r\n3.定期更换密码\r\n建议每90天更新一次，历史密码不重复使用。\r\n​​4.技术支持与例外处理​​\r\n若遗忘密码，请联系系统管理员SystemAdmin@swan.edu或者到网络安全中心提交工单。\r\n因科研任务、竞赛评审等特殊原因需延长处理的用户，请于5月25日前提交书面申请至网络安全中心（security@swan.edu）。\r\n信息安全关乎每位师生的权益，感谢您为构建可信赖的学术环境贡献力量！\r\n\r\n​​网络安全领导小组​​\r\n2025年5月8日','2025-05-08 11:31:04'),(5,2001,'新功能上线通知','竞赛管理系统新增「团队报名」功能，支持学生自由组队参赛，详情参见使用指南。','2025-05-10 10:31:04'),(6,2001,'欢迎来到竞赛管理系统','测试公告','2025-05-16 23:08:31');

/*Table structure for table `competition` */

DROP TABLE IF EXISTS `competition`;

CREATE TABLE `competition` (
  `competition_id` int NOT NULL AUTO_INCREMENT COMMENT '竞赛唯一ID',
  `title` varchar(200) NOT NULL COMMENT '竞赛标题',
  `description` text COMMENT '竞赛详细描述（富文本内容）',
  `host_unit_id` int NOT NULL COMMENT '主办单位ID（外键关联host_unit表）',
  `responsible_department_id` int NOT NULL COMMENT '责任院系ID（外键关联department表）',
  `level_id` int NOT NULL COMMENT '竞赛等级ID（外键关联competition_level表）',
  `signup_start_time` datetime NOT NULL COMMENT '报名开始时间（UTC时间）',
  `signup_end_time` datetime NOT NULL COMMENT '报名结束时间（UTC时间）',
  `competition_start_time` datetime NOT NULL COMMENT '竞赛开始时间（UTC时间）',
  `competition_end_time` datetime NOT NULL COMMENT '竞赛结束时间（UTC时间）',
  `status` enum('pending','available','active','ended','') CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT 'pending' COMMENT '竞赛状态（由触发器根据时间自动更新）',
  `admin_creator_id` int DEFAULT NULL COMMENT '管理员创建者ID（外键关联admin表，与teacher_creator_id二选一）',
  `teacher_creator_id` int DEFAULT NULL COMMENT '教师创建者ID（外键关联teacher表，与admin_creator_id二选一）',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间（UTC时间）',
  PRIMARY KEY (`competition_id`),
  KEY `idx_competition_status` (`status`),
  KEY `competition_ibfk_1` (`host_unit_id`),
  KEY `competition_ibfk_2` (`responsible_department_id`),
  KEY `competition_ibfk_3` (`level_id`),
  CONSTRAINT `competition_ibfk_1` FOREIGN KEY (`host_unit_id`) REFERENCES `host_unit` (`host_unit_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `competition_ibfk_2` FOREIGN KEY (`responsible_department_id`) REFERENCES `department` (`department_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `competition_ibfk_3` FOREIGN KEY (`level_id`) REFERENCES `competition_level` (`level_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=1015 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='竞赛信息表';

/*Data for the table `competition` */

insert  into `competition`(`competition_id`,`title`,`description`,`host_unit_id`,`responsible_department_id`,`level_id`,`signup_start_time`,`signup_end_time`,`competition_start_time`,`competition_end_time`,`status`,`admin_creator_id`,`teacher_creator_id`,`created_at`) values (1001,'2024年江苏省大学生程序设计竞赛','面向全省高校的ACM-ICPC赛制编程比赛，三人组队参赛。',1,2,4,'2025-05-12 11:35:41','2025-05-31 11:35:51','2025-06-20 11:35:56','2025-07-31 08:36:02','available',2001,NULL,'2025-05-10 11:36:27'),(1002,'2025年ACM国际大学生程序设计竞赛','全球最具影响力的大学生计算机编程赛事，三人一组在5小时内解决10-12个算法问题，考验算法设计与编码能力',1,1,1,'2025-05-16 12:57:02','2025-06-20 12:57:09','2025-08-01 12:57:15','2025-12-31 12:57:20','available',2001,NULL,'2025-05-17 12:57:33'),(1003,'2025年全国大学生广告艺术大赛','中国最大的高校广告创意竞赛，设置平面、视频、动画、互动等多个类别，命题来自企业真实需求',1,8,2,'2025-05-16 12:58:15','2025-06-30 12:58:25','2025-07-01 12:58:34','2025-12-31 12:58:37','available',2001,NULL,'2025-05-17 12:58:58'),(1007,'2025年全国大学生机械创新设计大赛','机械工程领域的创新竞赛，每届设定不同主题，要求提交实物作品并完成现场演示和答辩',2,5,2,'2025-06-17 00:00:00','2025-07-17 23:59:59','2025-09-17 00:00:00','2025-12-17 23:59:59','pending',NULL,NULL,'2025-05-17 13:29:49'),(1008,'2025年中国大学生服务外包创新创业大赛','聚焦服务外包领域的创新创业赛事，命题来自企业真实需求，强调解决方案的商业可行性',1,7,3,'2025-06-17 00:00:00','2025-07-17 23:59:59','2025-10-17 00:00:00','2025-12-17 23:59:59','pending',NULL,NULL,'2025-05-17 13:50:54'),(1009,'2025年秋季校园篮球赛','2025年秋季校园篮球赛是由XX大学体育部与学生会联合主办、各院系体育部和校篮球社协办的一项大型体育赛事，将于2025年9月15日至10月20日每周三、六下午在校体育馆和室外篮球场举行。本届赛事以\"青春无畏，逐梦篮途\"为主题，面向全校本科生和研究生开放报名，旨在通过篮球运动增强学生体质、促进院系交流、丰富校园文化生活。比赛设置男子5v5全场、女子3v3半场以及师生混合趣味赛等多个组别，赛程分为9月15-30日的预选赛、10月8-15日的淘汰赛和10月20日的总决赛三个阶段。参赛者可通过院系组队或自由组队方式报名，每队5-12人，个人报名者将由组委会协助组队，报名截止日期为2025年9月5日。赛事奖励丰厚，除冠亚季军团队将获得奖杯和800/500/300元奖金外，还设有MVP球员、最佳得分王等个人奖项，所有完赛队员均可获得校庆限量版运动手环。本届比赛将严格遵循国际篮联最新规则，由专业裁判团队执裁，确保赛事公平公正，为全校师生呈现一场精彩纷呈的篮球盛宴。',3,4,5,'2025-06-17 00:00:00','2025-09-01 23:59:59','2025-09-15 00:00:00','2025-10-21 23:59:59','pending',NULL,NULL,'2025-05-17 15:10:20'),(1010,'2025年校园金融模拟大赛','2025年校园金融模拟大赛是由XX大学经济学院主办的虚拟投资竞赛，将于10月10日至11月10日举行。比赛采用真实股市数据模拟交易环境，参赛者可以个人或组队（每队不超过3人）形式参与，通过为期一个月的投资操作，最终按投资收益率进行排名。赛事旨在通过实战模拟培养参赛者的金融分析能力、风险管控意识和投资决策水平，为对金融投资感兴趣的同学提供实践平台。优秀选手将获得经济学院颁发的获奖证书及实习推荐机会，表现突出的团队还将有机会参加全国金融模拟大赛。',3,7,5,'2025-05-29 00:00:00','2025-09-30 23:59:59','2025-10-10 00:00:00','2025-11-10 23:59:59','available',NULL,NULL,'2025-05-17 15:17:37'),(1011,'2025年全国大学生集成电路创新创业大赛','全国大学生集成电路创新创业大赛是指由工业和信息化部人才交流中心主办的，面向全国大学生的集成电路领域专业竞赛。这个比赛旨在服务集成电路产业发展需求，提升我国集成电路产业人才培养质量，打造产学研用协同创新平台。参赛学生通过完成特定的赛题，展示其在数字与SoC设计、频与模拟芯片设计、国产处理器与芯片应用以及FPGA设计与应用等方向的创新能力和实践水平。\n\n具体来说，全国大学生集成电路创新创业大赛具有以下特点：\n\n参赛要求：学生自行组队，每队1-3人。根据团队成员的学历层次，分为本科生组（A组）和研究生组（B组）。\n\n赛道类别：包括频与模拟芯片设计、数字与SoC设计、国产处理器与芯片应用、FPGA设计与应用等多个赛道，每个赛道都有具体的企业赞助和赛题设定。\n\n重要时间节点：比赛通常在1月份发布赛题，3月中旬完成报名。中期检查、分区决赛和总决赛分别在6月、7月和8月进行。\n\n参赛价值：获奖对本科生的保研、考研面试等有重要影响，同时有助于提升学生的创新实践能力、工程素质和团队协作精神。\n\n指导与准备：指导老师在比赛中扮演关键角色，帮助学生进行文献分析、创新解决方案的提出和实验结果的呈现。参赛学生需要有扎实的专业基础，如FPGA、嵌入式设计等，以及一定的学术论文撰写能力。',1,2,2,'2025-05-15 00:00:00','2025-07-17 23:59:59','2025-08-17 00:00:00','2025-12-17 23:59:59','available',NULL,NULL,'2025-05-17 20:56:18'),(1012,'2025年校园电竞联赛','025年校园电竞联赛是由校学生会与体育部联合主办的官方电子竞技赛事，将于10月15日至11月30日每周六在校园电竞馆举行。本届联赛设置《英雄联盟》（5v5召唤师峡谷）、《王者荣耀》（5v5王者峡谷）和《CS2》（5v5爆破模式）《无畏契约》（5v5爆破模式）四大主流电竞项目，面向全体在校生开放报名，每个项目限报32支战队。赛事采用\"小组循环赛+双败淘汰制\"的赛程体系，所有比赛均配备专业级设备与OB直播系统，确保竞技公平性。组委会特别设立总价值超2万元的奖金池，各项目冠军战队将获得1500元奖金及定制外设套装，亚军、季军分别奖励800元和500元，所有参赛选手均可获得校级体育学分加分。赛事期间还将同步举办\"电竞解说大赛\"和\"cosplay表演赛\"等周边活动，为校园电竞爱好者提供多元展示平台。本届联赛旨在通过规范化赛事推动校园电竞文化健康发展，培养团队协作与竞技精神，所有比赛均严格遵循\"绿色电竞\"原则，严禁代打、作弊等违规行为，违规者将取消参赛资格并通报批评。',3,4,5,'2025-05-10 00:00:00','2025-06-17 23:59:59','2025-09-17 00:00:00','2025-12-17 23:59:59','available',NULL,NULL,'2025-05-17 21:23:23'),(1013,'​2025全国大学生动物科学技能大赛​','由教育部主办的动物科学领域权威赛事，涵盖动物遗传育种、营养饲料、疾病防控等方向，参赛者需完成实验操作、案例分析及现场答辩，旨在提升学生实践创新能力。',1,3,2,'2025-05-10 00:00:00','2025-07-18 23:59:59','2025-09-18 00:00:00','2025-12-18 23:59:59','available',NULL,NULL,'2025-05-18 14:47:38'),(1014,'​​2025年“丝路杯”省级高校外语综合能力竞赛​','本届竞赛以“跨文化沟通与区域服务”为主题，涵盖​​多语种口译、商务谈判模拟、外宣文案写作、一带一路文化解说​​四大模块，采用“AI+专家”双评审机制，初赛为线上语言能力测试（含听力、翻译、跨文化案例分析），复赛增设虚拟仿真情境任务（如国际会议同传、跨境电商纠纷调解），决赛要求团队完成省级外事项目的全流程方案设计并答辩。赛事对接省级翻译人才库，优胜者将获得涉外企业实习推荐及省级外语能力认证证书，旨在培养兼具语言能力、专业素养和国际视野的新时代外语人才。',5,6,4,'2025-05-01 00:00:00','2025-08-19 23:59:59','2025-10-19 00:00:00','2026-03-19 23:59:59','available',NULL,NULL,'2025-05-19 18:13:33');

