  `student_id` int NOT NULL COMMENT '学生ID（外键student表）',
  `competition_id` int NOT NULL COMMENT '竞赛ID（外键competition表）',
  `status` enum('pending','approved','rejected') DEFAULT 'pending' COMMENT '审核状态（pending待审核/approved已通过/rejected已拒绝）',
  `teacher_approver_id` int DEFAULT NULL COMMENT '审批教师ID（外键关联teacher表，未审批时为空）',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '报名时间（UTC时间）',
  `team_id` int DEFAULT NULL COMMENT '队伍ID（外键team表）',
  PRIMARY KEY (`registration_id`),
  KEY `idx_registration_status` (`status`),
  KEY `1` (`student_id`),
  KEY `2` (`competition_id`),
  KEY `3` (`teacher_approver_id`),
  KEY `4` (`team_id`),
  CONSTRAINT `1` FOREIGN KEY (`student_id`) REFERENCES `student` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `2` FOREIGN KEY (`competition_id`) REFERENCES `competition` (`competition_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `3` FOREIGN KEY (`teacher_approver_id`) REFERENCES `teacher` (`teacher_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `4` FOREIGN KEY (`team_id`) REFERENCES `team` (`team_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10035 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='竞赛报名记录表';

