/*Table structure for table `score` */

DROP TABLE IF EXISTS `score`;

CREATE TABLE `score` (
  `score_id` int NOT NULL AUTO_INCREMENT COMMENT '成绩记录唯一ID',
  `team_id` int NOT NULL COMMENT '队伍ID（外键team表）',
  `teacher_id` int NOT NULL COMMENT '录入教师ID（外键teacher表）',
  `award_level` enum('一等奖','二等奖','三等奖','优胜奖') NOT NULL COMMENT '获奖等级',
  `certificate_path` varchar(255) DEFAULT NULL COMMENT '获奖证书文件路径（如OSS地址）',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '录入时间',
  PRIMARY KEY (`score_id`),
  KEY `idx_score_award` (`award_level`),
  KEY `score_ibfk_1` (`team_id`),
  KEY `score_ibfk_2` (`teacher_id`),
  CONSTRAINT `score_ibfk_1` FOREIGN KEY (`team_id`) REFERENCES `team` (`team_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `score_ibfk_2` FOREIGN KEY (`teacher_id`) REFERENCES `teacher` (`teacher_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=8 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='竞赛成绩表（按队伍评级）';

