/*Table structure for table `student` */

DROP TABLE IF EXISTS `student`;

CREATE TABLE `student` (
  `student_id` int NOT NULL AUTO_INCREMENT COMMENT '学生唯一ID',
  `name` varchar(50) NOT NULL COMMENT '学生姓名',
  `department_id` int NOT NULL COMMENT '所属院系ID（外键关联department表）',
  `email` varchar(100) NOT NULL COMMENT '学生邮箱（唯一登录账号）',
  `password` varchar(255) NOT NULL COMMENT '登录密码（bcrypt哈希存储，长度至少60字符）',
  PRIMARY KEY (`student_id`),
  UNIQUE KEY `email` (`email`),
  KEY `student_ibfk_1` (`department_id`),
  CONSTRAINT `student_ibfk_1` FOREIGN KEY (`department_id`) REFERENCES `department` (`department_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=2024090056 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='学生信息表';

