/*Table structure for table `teacher` */

DROP TABLE IF EXISTS `teacher`;

CREATE TABLE `teacher` (
  `teacher_id` int NOT NULL AUTO_INCREMENT COMMENT '教师唯一ID',
  `name` varchar(50) NOT NULL COMMENT '教师姓名',
  `department_id` int NOT NULL COMMENT '所属院系ID（外键关联department表）',
  `email` varchar(100) NOT NULL COMMENT '教师邮箱（唯一登录账号）',
  `password` varchar(255) NOT NULL COMMENT '登录密码（bcrypt哈希存储）',
  PRIMARY KEY (`teacher_id`),
  UNIQUE KEY `email` (`email`),
  KEY `teacher_ibfk_1` (`department_id`),
  CONSTRAINT `teacher_ibfk_1` FOREIGN KEY (`department_id`) REFERENCES `department` (`department_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=509002 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='教师信息表';

