/*Table structure for table `team` */

DROP TABLE IF EXISTS `team`;

CREATE TABLE `team` (
  `team_id` int NOT NULL AUTO_INCREMENT COMMENT '队伍唯一ID',
  `name` varchar(100) NOT NULL COMMENT '队伍名称',
  `competition_id` int NOT NULL COMMENT '关联竞赛ID（外键competition表）',
  `captain_id` int NOT NULL COMMENT '队长ID（外键student表）',
  `department_id` int DEFAULT NULL COMMENT '队伍所在院系ID',
  `teacher_id` int DEFAULT NULL COMMENT '指导教师ID',
  `member_count` int DEFAULT NULL COMMENT '队伍成员数量',
  `max_member_count` int DEFAULT NULL COMMENT '队伍最大成员数量',
  `created_at` datetime DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`team_id`),
  KEY `idx_team_competition` (`competition_id`),
  KEY `team_ibfk_2` (`captain_id`),
  KEY `team_ibfk_3` (`teacher_id`),
  KEY `team_ibfk_4` (`department_id`),
  CONSTRAINT `team_ibfk_1` FOREIGN KEY (`competition_id`) REFERENCES `competition` (`competition_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `team_ibfk_2` FOREIGN KEY (`captain_id`) REFERENCES `student` (`student_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `team_ibfk_3` FOREIGN KEY (`teacher_id`) REFERENCES `teacher` (`teacher_id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `team_ibfk_4` FOREIGN KEY (`department_id`) REFERENCES `department` (`department_id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=10013 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci COMMENT='竞赛队伍信息表';

