/* Trigger structure for table `team_member` */

DELIMITER $$

/*!50003 DROP TRIGGER*//*!50032 IF EXISTS */ /*!50003 `update_member_count_after_insert` */$$

/*!50003 CREATE */ /*!50017 DEFINER = 'root'@'localhost' */ /*!50003 TRIGGER `update_member_count_after_insert` AFTER INSERT ON `team_member` FOR EACH ROW BEGIN
    -- 更新对应team_id的member_count为当前成员数量
    UPDATE team t
    SET t.member_count = (
        SELECT COUNT(*) 
        FROM team_member tm 
        WHERE tm.team_id = NEW.team_id
    )
    WHERE t.team_id = NEW.team_id;
END */$$


DELIMITER ;

